result:
query ($path: String!){
	projects:contentfulProject(path: $path) {
    projectName
    slug
    headerImage {
      file {
        url
      }
    }
    projectOverview
    projectDetails
    territory
    contact
    contactEmail
    phone
    email
    pdfs {
      id
      title
      description
      file {
        url
      }
    }
    geoJson {
      file {
        url
      }
    }
    outreach {
      icon {
        file {
          url
        }
      }
      accountName
      url
    }
  }
}
